%script
begin
    -- Для загрузки данных из файла с разделителями, используем пакет DBMS_CLOUD
    DBMS_CLOUD.copy_data(
        table_name      => 'CHURN',
        file_uri_list   => 'https://objectstorage.eu-frankfurt-1.oraclecloud.com/n/cissandbox/b/osir-ml-workshops/o/Bank_Churn_Modelling.csv',
        format          => json_object('type' VALUE '','delimiter' value ';', 'ignoremissingcolumns' value 'true', 'skipheaders' value '1', 'numericcharacters' value ',.')
     );

end;
/

%script
-- используем sql операторы SAMPLE и SEED для рандомизированной выборки 60% записей в CHURN_TRAIN_DATA
CREATE OR REPLACE VIEW CHURN_TRAIN_DATA AS SELECT * FROM CHURN SAMPLE (60) SEED (1);

-- используем sql оператор MINUS для отображения оставшихся записей в CHURN_TRAIN_DATA
CREATE OR REPLACE VIEW CHURN_TEST_DATA AS SELECT * FROM CHURN MINUS SELECT * FROM CHURN_TRAIN_DATA;

%script

-- если вы запускаете скрипт повторно, убедитесь, что старые модели и таблицы удалены 

DROP TABLE CHURN_build_settings PURGE;
CALL DBMS_DATA_MINING.DROP_MODEL('CHURN_CLASS_MODEL');
DROP TABLE CHURN_APPLY_RESULT PURGE;

-- создим таблицу настроек и укажем два параметра:
-- ALGO_NAME - алгоритм, который будет использоваться для обучения модели
-- PREP_AUTO - автоматическая подготовка данных (технология Oracle ADP)
CREATE TABLE CHURN_build_settings (setting_name VARCHAR2(30), setting_value VARCHAR2(4000));
INSERT INTO CHURN_build_settings (setting_name, setting_value) VALUES ('ALGO_NAME', 'ALGO_RANDOM_FOREST');
INSERT INTO CHURN_build_settings (setting_name, setting_value) VALUES ('PREP_AUTO', 'ON');

-- создадим и обучим модель также как и при расчете значимых атрибутов выше
CALL DBMS_DATA_MINING.CREATE_MODEL('CHURN_CLASS_MODEL', 'CLASSIFICATION', 'CHURN_TRAIN_DATA', 'ROWNUMBER','EXITED', 'CHURN_build_settings');

-- применим обученную модель к тестовому набору данных для оценки ее качества
CALL DBMS_DATA_MINING.APPLY('CHURN_CLASS_MODEL','CHURN_TEST_DATA','ROWNUMBER','CHURN_APPLY_RESULT');

%script
DECLARE
   v_accuracy    NUMBER;
      BEGIN
        EXECUTE IMMEDIATE 'DROP TABLE CHURN_CM_TABLE';
        DBMS_DATA_MINING.COMPUTE_CONFUSION_MATRIX(v_accuracy, 'CHURN_APPLY_RESULT','CHURN_TEST_DATA','ROWNUMBER','EXITED','CHURN_CM_TABLE','PREDICTION','PROBABILITY');
        DBMS_OUTPUT.PUT_LINE('**** ТОЧНОСТЬ МОДЕЛИ ****: ' || ROUND(v_accuracy,4));
      END;
      /

%script
DECLARE
   v_area_under_curve NUMBER;
      BEGIN
        EXECUTE IMMEDIATE 'DROP TABLE CHURN_ROC_TABLE';
        DBMS_DATA_MINING.COMPUTE_ROC(v_area_under_curve, 'CHURN_APPLY_RESULT','CHURN_TEST_DATA','ROWNUMBER','EXITED','CHURN_ROC_TABLE','Yes','PREDICTION','PROBABILITY');
        DBMS_OUTPUT.PUT_LINE('**** ПЛОЩАДЬ ПОД ROC КРИВОЙ ****: ' || ROUND(v_area_under_curve,4));
      END;
      /
